import React from "react";

const CssClasses = {
    CONTACT: "contact",
    NAME: "contact__name",
    LIST: "contact__list",
}

const Contact = () => {
    return (
    <div className={CssClasses.CONTACT + " container"}>
        <h1 className={CssClasses.NAME}>Duis Aute</h1>
        <div className={CssClasses.LIST}>
            <h2>Contact </h2>
            <ul>
                <li><a href="#"><i className="bi bi-whatsapp"> duisaute</i></a></li>
                <li><i className="bi bi-envelope"></i> duisaute@mail.ru</li>
                <li><i className="bi bi-telephone"></i> +2-345-678-97-47</li>
                <li><i className="bi bi-geo"></i>Neque, Porro quisquam 45, 123414</li>

            </ul>

        </div>
    </div>
    );
};

export default Contact;
